import React from "react";

let ViewContact = () => {
    return (
      <React.Fragment>
        <section className="view-contact-intro p-3">
          <div className="container">
            <div className="row">
              <div className="col">
                <p className="h4 text-warning fw-bold">View Contact</p>
              </div>
            </div>
          </div>
        </section>
        <section className="view-contact">

        </section>
      </React.Fragment>  
    )
};

export default ViewContact;
